import styled from 'styled-components'

export const Button = styled.button`
    outline: none;
    border: none;
    cursor: pointer;
    color: #ffff;
    background-color: blue;
    border-radius: 15px;
    padding: 16px 20px;
    width: 100%;
    font-size: 19px;
    p

    &:hover {
         background: #11145A;

    }
`
